theme.template:
{#- Theme: base.html -#}

{%- if media.background_image_url -%}
<div id="taplist-background">
  <img
    src="{{ media.background_image_url }}"
    alt="background" />
</div>
{% endif -%}

{%- if display_settings.trial_watermark -%}
<div id="taplist-trial-watermark" class="taplist-trial-animation">
  <div>
    <div id="watermark">{{ display_settings.trial_watermark }}</div>
  </div>
</div>
{% endif -%}

<div id="taplist-display">

{%- block header -%}

  {%- if theme_settings.has_top_header != false and (theme_settings.header_text or media.header_image_url) -%}
  <div id="taplist-header" class="taplist-header text-header">
    {%- if theme_settings.header_text -%}
        <div
          class="font-header autofit-text ellipsize-text fill-parent-width"
          data-max-shrink="0.1">
            {{ theme_settings.header_text }}
        </div>
    {%- endif -%}
    {%- if media.header_image_url -%}
      <img class="taplist-header-image"
        src="{{ media.header_image_url }}"
        alt="{{ theme_settings.header_text }}" />
    {%- endif -%}
  </div>
  {% endif -%}

{%- endblock header -%}

  {%- if theme_settings.snow %}
  <div id="taplist-snowflakes"></div>
  {% endif -%}

  <div id="display-main">
    {# Handle "auto" column setting. #}
{% set columns = theme_settings.columns %}
{% if not columns or columns == "0" %}
  {% if data.initial_page_size <= 4 %}
    {% set columns = 1 %}
  {% else %}
    {% set columns = 2 %}
  {% endif %}
{% endif %}

{% macro render_item(menu_item) %}
  {% set prices = menu_item.prices %}
  {% if menu_item.kind == "tap" %}
    {% set tap = menu_item.tap %}
    {% set keg = tap.current_keg %}
    {% if keg %}
      {% set beverage = tap.current_keg.beverage %}
    {% else %}
      {% set beverage = None %}
    {% endif %}
  {% elif menu_item.kind == "keg" %}
    {% set tap = None %}
    {% set keg = menu_item.keg %}
    {% set beverage = keg.beverage %}
  {% else %}
    {% set tap = None %}
    {% set keg = None %}
    {% set beverage = menu_item.beverage %}
  {% endif %}

  <td>
    <div class="taplist-row">
      {% if theme_settings.show_logo %}
        {# Show beverage logo. #}
        <div class="taplist-row-small-block">
          {% if menu_item.image_url %}
            <img src="{{ menu_item.image_url }}">
          {% endif %}
        </div>
      {% endif %}

      {% if theme_settings.show_keg %}
        {# Show keg illustration or tap override. #}
        <div class="taplist-row-small-block">
          <img src="{{ menu_item.illustration_url }}">
        </div>
      {% endif %}

      <div class="taplist-row-block">
        {# Main title and description #}
        <h2>
          {% if tap and tap.number and theme_settings.show_tap_numbers %}
            {{ tap.number }}.
          {% endif %}

          {% if tap and not beverage %}
            {{ theme_settings.offline_tap_text }}
          {% else %}
            {% if keg and keg.is_on_deck and theme_settings.on_deck_text %}
              {{ theme_settings.on_deck_text }}:
            {% endif %}
            {{ beverage.name }}
          {% endif %}
        </h2>

        {% if beverage %}
          {% if theme_settings.show_producer and not beverage.producer.is_default_producer %}
            <h4>{{ beverage.producer.name }}</h4>
          {% endif %}

          {% if prices.length %}
            <ul class="taplist-price-set font-secondary">
              {% for price in prices.slice(0, 3) %}
                <li>
                  {{ price|format_price(theme_settings.show_price_sizes) }}
                </li>
              {% endfor %}
            </ul>
          {% endif %}

          {% if theme_settings.show_description %}
            <div class="taplist-description font-secondary">
              {% if keg and keg.description %}
                {% set description = keg.description %}
              {% elif beverage and beverage.description %}
                {% set description = beverage.description %}
              {% endif %}
              {% if description %}
                {% if theme_settings.shorten_descriptions == false %}
                  {{ description|markup }}
                {% else %}
                  {{ description|ellipsize|markup }}
                {% endif %}
              {% endif %}
            </div>
          {% endif %}

          <ul class="taplist-metric-set font-tertiary">
            {% if theme_settings.show_style and beverage.style %}
            <li><b>{{ beverage.style.style }}</b></li>
            {% endif %}

            {% if theme_settings.show_abv and beverage.abv_percent %}
            <li><b>ABV:</b> {{ beverage.abv_percent }}%</li>
            {% endif %}

            {% if theme_settings.show_srm and beverage.srm %}
            <li><b>SRM:</b> {{ beverage.srm }}</li>
            {% endif %}

            {% if theme_settings.show_ibu and beverage.ibu %}
            <li><b>IBU:</b> {{ beverage.ibu }}</li>
            {% endif %}

            {% if theme_settings.show_og and beverage.original_gravity %}
            <li><b>OG:</b> {{ beverage.original_gravity }}</li>
            {% endif %}

            {% if theme_settings.show_fg and beverage.final_gravity %}
            <li><b>FG:</b> {{ beverage.final_gravity }}</li>
            {% endif %}
          </ul>
          {% endif %}
      </div>
    </div>
  </td>
{% endmacro %}

<div id="auto-carousel">
  {% for page in data.paginated_items %}
    <div>
    <table class="taplist-table
      {% if theme_settings.striped %}taplist-table-striped{% endif %}
      {% if columns == 4 %}
        taplist-table-four-col
      {% elif columns == 3 %}
        taplist-table-three-col
      {% elif columns == 2 %}
        taplist-table-two-col
      {% else %}
        taplist-table-one-col
      {% endif %}">
    <tbody>
      {% if loop.index0 % columns == 0 %}<tr>{% endif %}
      {% for item in page.items %}
        {{ render_item(item) }}
        {% if loop.last %}
          {# Add blank cells if this is the final row. #}
          {% set remain = columns - 1 - (loop.index0 % columns) %}
          <!-- remaining: {{ remain }} -->
          {% for i in range(0, remain) %}
            <td>&nbsp;</td>
          {% endfor %}
        {% endif %}

        {% if loop.index % columns == 0 or loop.last %}</tr>{% endif %}
      {% endfor %}
    </tbody>
    </table>
    </div>
  {% endfor %}

</div>

    {%- block main -%}
    {%- endblock -%}
  </div>

  {%- if theme_settings.show_credit_footer != false -%}
  <div id="taplist-footer" class="taplist-credit-animation">
    Powered by <b>Taplist.io</b>{% if display_settings.footer_message %} &ndash; {{ display_settings.footer_message }}{% endif %}
  </div>
  {% endif -%}

</div>

theme.css:
{# Begin base CSS #}
/* Begin base CSS. */

html {
  font-size: {% if theme_settings.zoom %}{{ theme_settings.zoom }}{% else %}1{% endif %}vh;
}

.taplist-header,
h1,
h2,
h3,
h4,
h5,
h6 {
  margin-top: 0px;
  margin-bottom: 0px;
  font-weight: normal;
  line-height: 110%;
}

body,
table {
  font-size: 2rem;
}

.taplist-header, h1 {
  font-size: 8rem;
  line-height: 110%;
  @media (max-aspect-ratio: 1/1) {
    font-size: 4rem;
  }
}

h2 {
  font-size: 4rem;
  line-height: 110%;
}

h2 small {
  font-size: 2.5rem;
  line-height: 110%;
}

h3 {
  font-size: 2rem;
  line-height: 110%;
}

h4 {
  font-size: 2rem;
  line-height: 110%;
}

p {
  font-size: 2rem;
  margin-bottom: 2rem;
  margin-top: 0;
}

p:last-child {
  margin-bottom: 0;
}

.taplist-header, h1, h2, h3 {
  {% if theme_settings.primary_font and theme_settings.primary_font.font %}
    font-family: '{{ theme_settings.primary_font.font }}', serif;
    color: {{ theme_settings.primary_font.color }};
  {% else %}
    {# TODO delete me when fonts migrated #}
    {% if theme_settings.primary_font %}
    font-family: '{{ theme_settings.primary_font }}', serif;
    {% endif %}

    {% if theme_settings.primary_color %}
    color: {{ theme_settings.primary_color }};
    {% endif %}
  {% endif %}
}

h4, small {
  {% if theme_settings.tertiary_font and theme_settings.tertiary_font.font %}
    font-family: '{{ theme_settings.tertiary_font.font }}', serif;
    color: {{ theme_settings.tertiary_font.color }};
  {% else %}
    {# TODO delete me when fonts migrated #}
    {% if theme_settings.tertiary_font %}
    font-family: '{{ theme_settings.tertiary_font }}', serif;
    {% endif %}

    {% if theme_settings.tertiary_color %}
    color: {{ theme_settings.tertiary_color }};
    {% endif %}
  {% endif %}
}

body {
  {% if theme_settings.background_color %}
  background-color: {{ theme_settings.background_color }};
  {% endif %}
}

.font-primary {
  {% if theme_settings.primary_font and theme_settings.primary_font.font %}
    font-family: '{{ theme_settings.primary_font.font }}', serif;
    color: {{ theme_settings.primary_font.color }};
  {% else %}
    {# TODO delete me when fonts migrated #}
    {% if theme_settings.primary_font %}
    font-family: '{{ theme_settings.primary_font }}', serif;
    {% endif %}
    {% if theme_settings.primary_color %}
    color: {{ theme_settings.primary_color }};
    {% endif %}
  {% endif %}
}

.font-secondary {
  {% if theme_settings.secondary_font and theme_settings.secondary_font.font %}
    font-family: '{{ theme_settings.secondary_font.font }}', serif;
    color: {{ theme_settings.secondary_font.color }};
  {% else %}
    {# TODO delete me when fonts migrated #}
    {% if theme_settings.secondary_font %}
    font-family: '{{ theme_settings.secondary_font }}', serif;
    {% endif %}
    {% if theme_settings.secondary_color %}
    color: {{ theme_settings.secondary_color }};
    {% endif %}
  {% endif %}  
}

.font-tertiary {
  {% if theme_settings.tertiary_font and theme_settings.tertiary_font.font %}
    font-family: '{{ theme_settings.tertiary_font.font }}', serif;
    color: {{ theme_settings.tertiary_font.color }};
  {% else %}
    {# TODO delete me when fonts migrated #}
    {% if theme_settings.tertiary_font %}
    font-family: '{{ theme_settings.tertiary_font }}', serif;
    {% endif %}
    {% if theme_settings.tertiary_color %}
    color: {{ theme_settings.tertiary_color }};
    {% endif %}
  {% endif %}    
}

#taplist-background img {
  {% if display_settings.background_image_opacity %}
    opacity: {{ display_settings.background_image_opacity / 100 }};
  {% elif theme_settings.background_image_opacity %}
    opacity: {{ theme_settings.background_image_opacity / 100 }};
  {% else %}
    opacity: 0.5;
  {% endif %}
}

.mdc-linear-progress__bar-inner {
  {% if theme_settings.primary_color %}
  background-color: {{ theme_settings.primary_color }};
  {% endif %}
}

.carousel-visible {
  visibility: visible;
  opacity: 1;
  transition: opacity 0.3s cubic-bezier(0.12, 0, 0.39, 0);
}

.carousel-appearing {
  opacity: 0;
}

.carousel-hidden {
  visibility: hidden;
  opacity: 0;
  transition: visibility 0s 1s, opacity 1s linear;
}

.carousel-gone {
  display: none !important;
}

.fill-parent {
  width: 100%;
  height: 100%;
}

.fill-parent-width {
  width: 100%;
}

.single-line {
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}

ul.taplist-price-set {
  padding: 0px;
  margin: 0px;
}

ul.taplist-price-set li {
  list-style: none;
  display: inline;
}

ul.taplist-price-set li:after {
  content: ' \00b7';
  margin-left: 2px;
  margin-right: 2px;
}

ul.taplist-price-set li:last-child:after {
  content: none;
}

ul.taplist-metric-set {
  padding: 0px;
  margin: 0px;
}

ul.taplist-metric-set li {
  list-style: none;
  display: inline;
}

ul.taplist-metric-set li:after {
  content: ' \00b7';
  margin-left: 4px;
  margin-right: 4px;
}

ul.taplist-metric-set li:last-child:after {
  content: none;
}

.taplist-table {
  table-layout: fixed;
  width: 100%;

  /* Center in container. */
  margin: 0 auto;
}

.taplist-table td {
  vertical-align: top;
  padding-top: 6px;
  padding-left: 12px;
  padding-right: 6px;
}

.taplist-table .keg-image {
  height: 100%;
  max-height: 10vh;
}

.taplist-table-striped tr:nth-child(odd) {
  background-color: rgba(255, 255, 255, 0.1);
}

.taplist-table-striped tr:nth-child(even) {
  background-color: rgba(255, 255, 255, 0.2);
}

/* End base CSS. */

{# End base CSS #}
{# Begin theme CSS #}
/* Custom CSS */

.taplist-table td {
  vertical-align: top;
  padding-top: 0px;
  padding-left: 0px;
  padding-right: 0px;
}

.taplist-row {
  display: flex;
  padding: 1vh;
  margin: 0.5vh;
  {% if theme_settings.center_items %}
  align-items: center;
  {% endif %}
}

.taplist-row .taplist-row-small-block {
  max-width: 15%;
  flex: 0 0 15%;
  padding-right: 1vh;
}

.taplist-row .taplist-row-small-block img {
  max-height: {{ 16 * theme_settings.zoom }}vh;
  max-width: 100%;
}

.taplist-row .taplist-row-block {
  flex: 1;
}

{# End theme CSS #}
